DROP TABLE IF EXISTS app.names;
DROP SCHEMA IF EXISTS app;
CREATE SCHEMA app;

--name, gender, name_type, name_length, name_common, rating
create table app.names
(
	id SERIAL not null,
	primary key(id),
	name varchar(50) not null,
	gender int null,
	religion int null,
	name_type int null,
	is_ilir int null,
	name_length int null,
	regularity int null,
	meaning varchar(400) null,
	rating int null,
	date_retr date null
);

